import { React, useContext, useEffect } from "react";
import { Grid} from '@material-ui/core';
import { UserContext } from '../App';

function Home(){
  const [posts,setPosts] = ([{}]);
  const user = useContext(UserContext);
  return(
    <div>
      <Grid container item xs = {9}>
          <h1>{user["username"]}</h1>
      </Grid>
    </div>
  )
}

export default Home;
